import logo from './logo.svg';
import './App.css';
import Sidenav from './components/Sidenav';
import Dashboard from './pages/dashboard';
import {Routes, Route, BrowserRouter} from "react-router-dom"

function App() {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route path="/" exact element={<Dashboard />}></Route>
        </Routes>
      </BrowserRouter>
    </>




  );
}

export default App;
